import styled from 'styled-components';
import {PageWrap} from '../../components/common/styled'
import Header from '../../components/common/header'

const Exploring = () => {
  return (
    <PageWrap>
      <Header />
      <CompanyListBox>
        <CompanyListCenter>
          <CompanyFilterBox>
            <FilterLiftBox>
              <TagFilterBtn>태그 딱 맞는 기업 찾기</TagFilterBtn>
            </FilterLiftBox>
            <FilterRightBox></FilterRightBox>
          </CompanyFilterBox>
        </CompanyListCenter>
      </CompanyListBox>
    </PageWrap>
  )
}

const CompanyListBox = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`
const CompanyListCenter = styled.div`
  max-width: 1060px;
  width: 100%;
  display: flex;
  flex-direction: column;
  padding: 20px 0 80px;
  background: red;
`
const CompanyFilterBox = styled.div`
  top: 50px;
  margin-bottom: 19px;
  padding-top: 10px;
`
const FilterLiftBox = styled.div`
`
const FilterRightBox = styled.div`
`
const TagFilterBtn = styled.button`
`
export default Exploring;
